import React, {Component, Fragment} from "react";
import { Col, Container, Row } from "react-bootstrap";
//import call from '../../asset/img/icon/call.png';
//import man from '../../asset/img/icon/man.png';
//import send from '../../asset/img/icon/send.png';

class Services extends Component{
    render(){
        return(
            <Fragment>
                <Container>
                   <Row className="text-center">
                       <h1><ins>Service Section.</ins></h1>

                        <Card style={{ width: '18rem' }}>
                        <Card.Img variant="top" src="fd" />
                        <Card.Body>
                            <Card.Title>Card Title</Card.Title>
                            <Card.Text>
                            Some quick example text to build on the card title and make up the bulk of
                            the card's content.
                            </Card.Text>
                            <Button variant="primary">Go somewhere</Button>
                        </Card.Body>
                        </Card>




                       <Col lg={4} md={6} sm={12}>
                           <div>
                               {/* <img src={call}/> */}
                           </div>
                       </Col>
                       <Col lg={4} md={6} sm={12}>
                            <div>
                               {/* <img src={man}/> */}
                           </div>
                       </Col>
                       <Col lg={4} md={6} sm={12}>
                           <div>
                               {/* <img src={send}/> */}
                           </div>
                       </Col>
                   </Row>
                </Container>
            </Fragment>
        )
    }
}
export default Services;
